import React from 'react';
import logo from './logo.svg';
import './App.css';
import PortfolioProject from './components/PortfolioProject';
import { List } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Rasengan!
        </p>
      </header>

      <body>
        <List>
          <PortfolioProject
            name="Video ThumbnailDL"
            description="A simple application that downloads Youtube video thumbnails"
            link="" />

          <PortfolioProject
            name="Video ThumbnailDL"
            description="A simple application that downloads Youtube video thumbnails"
            link="" />
        </List>

      </body>
    </div>
  );
}

export default App;
